import React from "react";
import "./Header.scss";
import title from "../images/new-logo-ngang.png";

class App extends React.Component {
  render() {
    return (
      <header className="header">
          <img className="title" src={title} alt="Title Rick And Morty" />
      </header>
    );
  }
}

export default App;
